  state = {
    phoneArr: [
      {
        name: "http://loremflickr.com/640/480/cats",
        img: "http://loremflickr.com/640/480/technics",
        price: "489.00",
        id: "1",
      },
      {
        name: "http://loremflickr.com/640/480/cats",
        img: "http://loremflickr.com/640/480/technics",
        price: "657.00",
        id: "2",
      },
      {
        name: "http://loremflickr.com/640/480/cats",
        img: "http://loremflickr.com/640/480/technics",
        price: "873.00",
        id: "3",
      },
      {
        name: "http://loremflickr.com/640/480/cats",
